shader = Shader(
[[
out vec2 vUV;
void main() {
  vUV = uv;
  gl_Position = vec4(position, 1.0);
}
]],
[[
in vec2 vUV;
float sdBox(const in vec2 p, const in vec2 b) {
  vec2 d = abs(p)-b;
  return length(max(d,0.0)) + min(max(d.x,d.y),0.0) - 0.1;
}
void main() {
  vec2 p = (vUV - 0.5) * vec2(resolution.x / resolution.y, 1.0) * 16.0;
  float d = sdBox(vec2(-4.5, 0) - p, vec2(1, 4));
  d = min(d, sdBox(vec2(-2.5, 0) - p, vec2(2, 0.75)));
  d = min(d, sdBox(vec2(-0.5, 0) - p, vec2(1, 4)));
  d = min(d, sdBox(vec2(3.5, 3) - p, vec2(2, 1)));
  d = min(d, sdBox(vec2(3.5, 0) - p, vec2(0.75, 4)));
  d = min(d, sdBox(vec2(3.5, -3) - p, vec2(2, 1)));
  float a = 1.0 - smoothstep(-0.02, 0.02, d);
  fragColor = vec4(vec3(vUV.y, 0.0, 1 - vUV.x) * a, 1.0);
}
]]
)

log([[
# #001 Shader
Press *CTRL+E* to edit source
]])

function loop()
  shader:render()
end

boxShader = Shader(
[[
out vec3 vNormal;
void main() {
  vNormal = normal;
  gl_Position = projectionMatrix * viewMatrix * modelMatrix * vec4(position, 1.0);
}
]],
[[
in vec3 vNormal;
void main() {
  fragColor = vec4(normalize(vNormal) * 0.5 + 0.5, 1.0);
}
]]
)
box = Mesh("box", boxShader)

planeShader = Shader(
[[
out vec2 vUV;
void main() {
  vUV = uv;
  gl_Position = projectionMatrix * viewMatrix * modelMatrix * vec4(position, 1.0);
}
]],
[[
in vec2 vUV;
uniform sampler2D colorTexture;
void main() {
  fragColor = texture(colorTexture, vUV);
}
]]
)
planeShader:uniformInt("colorTexture", 0)
plane = Mesh("plane", planeShader)
plane:setScale(4, 4, 1)

framebuffer = Framebuffer(1, true)


