void sun(double x, double y)
{


    glBegin(GL_TRIANGLE_FAN);
    for (i = 0;i < 360;i++)
    {
        x = x + cos((i * 3.14) / 180) * s;
        y = y + sin((i * 3.14) / 180) * s;

        glVertex2d(x, y);

    }

    glEnd();
}

void cloud(double x, double y)
{


    glBegin(GL_TRIANGLE_FAN);
    for (i = 0;i < 360;i++)
    {
        x = x + cos((i * 3.14) / 180) * r;
        y = y + sin((i * 3.14) / 180) * r;

        glVertex2d(x, y);

    }
    glEnd();
}



void cloud2(double x, double y)
{


    glBegin(GL_TRIANGLE_FAN);
    for (i = 0;i < 360;i++)
    {
        x = x + cos((i * 3.14) / 180) * c2;
        y = y + sin((i * 3.14) / 180) * c2;

        glVertex2d(x, y);

    }
    glEnd();
}

void leaf(double x, double y)
{


    glBegin(GL_TRIANGLE_FAN);
    for (i = 0;i < 360;i++)
    {
        x = x + cos((i * 3.14) / 180) * 0.15;
        y = y + sin((i * 3.14) / 180) * 0.15;

        glVertex2d(x, y);

    }
    glEnd();
}


