#include <stdio.h>
#include <stdlib.h>
#include "TP4.h"
#include <ctype.h>
#include <string.h>
#define TMAX 500

//CONSTRUCTION DE L'ANNEXE


//Ajouter un element dans une liste triée
T_Position* ajouterPosition(T_Position *listeP, int ligne, int ordre){
    T_Position* nouveau = malloc(sizeof(T_Position));
    nouveau->numeroLigne = ligne;
    nouveau->ordre = ordre;
    nouveau->suivant = listeP;
    return nouveau;
}

//Creer un nouveau noeud
T_Noeud* creerNoeud(char* mot, int ligne, int ordre) {
    T_Noeud* nouveauNoeud = malloc(sizeof(T_Noeud));
    nouveauNoeud->mot = strdup(mot);
    nouveauNoeud->filsDroit = NULL;
    nouveauNoeud->filsGauche = NULL;
    nouveauNoeud->listePosition = ajouterPosition(NULL, ligne, ordre);
    nouveauNoeud->nbOccurences = 1;
    return nouveauNoeud;
}

//Ajouter un mot à l'Index
T_Noeud* ajouterOccurence(T_Noeud *racine, T_Index *index, char *mot, int ligne, int ordre) {
    if (racine == NULL) {
        return creerNoeud(mot, ligne, ordre);
    }

    int comparaison = strcmp(mot, racine->mot);
    if (comparaison == 0) {
        racine->nbOccurences++;
        racine->listePosition = ajouterPosition(racine->listePosition, ligne, ordre);
    } else if (comparaison < 0) {
        racine->filsGauche = ajouterOccurence(racine->filsGauche, index, mot, ligne, ordre);
    } else {
        racine->filsDroit = ajouterOccurence(racine->filsDroit, index, mot, ligne, ordre);
    }

    if(comparaison != 0)
        index->nbMotsDistincts++;

    return racine;
}

// Indexer un fichier
int indexerFichier(T_Index *index, char *filename){
    int nbrMot = 0;
    FILE* fichier = fopen(filename,"r");
    char str[TMAX];
    int ligne = 1;
    int ordre = 1;

    if (fichier != NULL){
        while (fgets(str, TMAX, fichier) != NULL){
            char* mot = strtok(str, " ,.\n");
            while (mot != NULL) {
                index->racine = ajouterOccurence(index->racine, index, mot, ligne, ordre);
                index->nbMotsTotal++;
                nbrMot++; // Incrémentation du nombre de mots
                mot = strtok(NULL, " ,.\n");
                ordre++;
            }
            ligne++;
            ordre = 1;
        }
        fclose(fichier);
    } else {
        printf("Impossible d'ouvrir le fichier %s\n", filename);
        return -1;
    }
    return nbrMot;
}




// Fonction pour afficher l'arbre

void afficherNoeud(T_Noeud* noeud) {
    if(noeud == NULL)
        return;
    
    afficherNoeud(noeud->filsGauche);
    printf("Mot: %s, Occurences: %d, Positions: ", noeud->mot, noeud->nbOccurences);

    T_Position* pos = noeud->listePosition;
    while (pos != NULL) {
        printf("[Ligne: %d, Ordre: %d] ", pos->numeroLigne, pos->ordre);
        pos = pos->suivant;
    }
    printf("\n");
    afficherNoeud(noeud->filsDroit);
}

void afficherIndex(T_Index *index) {
    afficherNoeud(index->racine);
}


void infixeP(char*c, T_Noeud* n){
    if(n == NULL) return;

    infixeP(c,n->filsGauche);
    if(*c!=n->mot[0]){
        *c =n->mot[0];
        char maj=toupper(*c);
        printf("\n%c\n",maj);
    }
    printf("|--%c",toupper(n->mot[0]));
    for (int i=1; i<strlen(n->mot);i++){
        printf("%c",n->mot[i]);
    }
    printf("\n");
    T_Position* p=n->listePosition;
    while(p!=NULL){
        printf("|---(l:%d, o:%d, p:%d)\n",p->numeroLigne, p->ordre, p->numeroPhrase);
        p=p->suivant;
    }
    infixeP(c,n->filsDroit);
}

//Rechercher un mot dans l'index
T_Noeud *rechercherMot(T_Index *index, char *mot) {
    char *mot_rechercher = mot;
    while (*mot_rechercher) {
      *mot_rechercher = toupper((unsigned char) *mot_rechercher);
      mot_rechercher++;
    }
    for (int i=1; i<=strlen(mot);i++){
        mot_rechercher[i]=tolower(mot[i]);
    }

    T_Noeud *noeud = index->racine;
    while (noeud != NULL) {
        int comparaison = strcmp(mot_rechercher, noeud->mot);
        if (comparaison == 0) {
            return noeud;
        } else if (comparaison < 0) {
            noeud = noeud->filsGauche;
        } else {
            noeud = noeud->filsDroit;
        }
    }
    free(mot_rechercher);
    return NULL;
}

